import React, { useState , useEffect } from 'react';
import './App.css';
import Axios from 'axios'


function App() {

   const [data,setdata ] = useState()
   const getData = async()=>{
    const response = await Axios.get("http://localhost:5001/getData")
    setdata(response.data)
   }

  return (
    <div className="App">
     <input type="text" />
     <div>{data}</div>
    </div>
  );
}

export default App;
